import React, { Component } from 'react'
import { withRouter, Route } from 'react-router-dom'
import Detail from '../message/detail'
class index extends Component {
  handleGo = () => {
    this.props.history.go(-2)
  }
  handlePush = () => {
    const obj = { id: '211', title: 'Ernest' }
    // params参数
    this.props.history.push(`/home/message/detail/${obj.id}/${obj.title}`)
    // // search参数
    // this.props.history.push(`/home/message/detail?id=${obj.id}&title=${obj.title}`)
    // // state参数
    // this.props.history.push('/home/message/detail', { id: obj.id, title: obj.title })
  }
  handleReplace = () => {
    this.props.history.replace()
  }
  render() {
    return (
      <div>
        <ul>
          <li><button onClick={this.handleGo}>GO</button></li>
          <li><button onClick={this.handlePush}>Push</button></li>
          <li><button onClick={this.handleReplace}>Replace</button></li>
        </ul>
        <Route path="/home/message/detail/:id/:title" component={Detail}></Route>
      </div>


    )
  }
}
export default withRouter(index)
